import React from "react";
import { withRouter } from "react-router-dom";
import {
  Container,
  Card,
  CardContent,
  Typography,
  withStyles,
  TextField,
  Grid,
  Button,
  Hidden,
  // Link
} from "@material-ui/core";
import Autocomplete from "@material-ui/lab/Autocomplete";
import ArrowRightIcon from "@material-ui/icons/ArrowRight";
import DialogComponent from "../../components/dialog/index";
import CheckCircleOutlineIcon from "@material-ui/icons/CheckCircleOutline";
import CheckboxLabels from "../../components/checkbox/index2";
import DateFnsUtils from "@date-io/date-fns";

import {
  MuiPickersUtilsProvider,
  KeyboardDatePicker,
} from "@material-ui/pickers";
import axios from "axios";
import moment from "moment";
import config from "../../config";
// style
const styles = (theme) => ({
  root: {
    width: "100%",
    background: theme.palette.mainbackground.default,
    opacity: 1,
    padding: "30px 0px",
  },
  title: {
    fontSize: 16,
    fontWeight: 600,
    // color: "#012834"
  },
  card: {
    background: theme.palette.background.paper,
    boxShadow: "0px 5px 10px #00000014",
    borderRadius: 16,
    opacity: 1,
    margin: "20px 0px",
  },
  card_title: {
    borderBottom: `2px solid ${theme.palette.mainbackground.default}`,
    fontWeight: "bold",
    fontSize: 14,
    [theme.breakpoints.only("xs")]: {
      height: "20px",
    },
  },
  clear: {
    boxShadow: "0px 3px 6px #0049903D",
    border: `1px solid #4BCD3E`,
    opacity: 0.9,
    fontSize: 12,
    borderRadius: 8,
    fontWeight: 600,
    marginLeft: 0,
    padding: "7px 16px",
    marginTop: "15px",
    width: "100px",
    [theme.breakpoints.only("xs")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "0px",
    },
    [theme.breakpoints.only("sm")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "0px",
    },
  },

  clear112: {
    boxShadow: "0px 3px 6px #0049903D",
    border: `1px solid #4BCD3E`,
    opacity: 0.9,
    fontSize: 12,
    borderRadius: 8,
    fontWeight: 600,
    marginLeft: 22,
    padding: "10px 16px",
    marginBottom: "0px",
    marginTop: "30px",

    [theme.breakpoints.only("md")]: {
      width: "200px",
      marginLeft: 0,
      marginTop: "30px",
    },
  },

  clear1: {
    boxShadow: "0px 3px 6px #0049903D",
    border: `1px solid #4BCD3E`,
    opacity: 0.9,
    fontSize: 12,
    borderRadius: 8,
    fontWeight: 600,
    marginLeft: 22,
    padding: "10px 16px",
    marginBottom: "0px",
    marginTop: "30px",

    [theme.breakpoints.only("xs")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "20px",
    },
    [theme.breakpoints.only("sm")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "0px",
    },
    [theme.breakpoints.only("md")]: {
      width: "95px",
      marginLeft: 0,
      marginTop: "30px",
    },
  },
  text_title: {
    padding: "6px 0px",
    opacity: 0.9,
  },
  body: {
    padding: "30px 0px",
  },
  btns: {
    margin: "20px 0px",
  },

  submit: {
    border: `2px solid ${theme.palette.primary.main}`,
    background: theme.palette.primary.main,
    boxShadow: "0px 3px 6px #0049903D",
    borderRadius: 8,
    fontSize: 12,
    opacity: 0.9,
    marginRight: 12,
    "&:hover": {
      background: theme.palette.primary.main,
    },
  },
  d_icon: {
    margin: "auto",
    width: "100%",
    cursor: "pointer",
    textAlign: "center",
    color: theme.palette.primary.main,
    fontSize: 50,
  },
  d_title: {
    fontSize: 16,
    fontWeight: 600,
    textAlign: "center",
    color: theme.palette.secondary.main,
    opacity: 0.8,
    letterSpacing: 1,
    paddingBottom: "12px",
  },
  submit1: {
    marginTop: "35px",
    background: "#4BCD3E",
    boxShadow: "0px 3px 6px #0049903D",
    borderRadius: 8,
    fontSize: 12,
    opacity: 0.9,
    marginLeft: "20px",
    color: "#2A2A2A",
    [theme.breakpoints.only("xs")]: {
      marginLeft: "0px",
      marginTop: "0px !important",
      marginRight: "20px",
    },
  },
  submitbotton: {
    [theme.breakpoints.only("xs")]: {
      marginRight: "0px !important",
    },
    [theme.breakpoints.only("sm")]: {
      marginRight: "0px !important",
    },
  },
  d_btn: {
    textAlign: "center",
    margin: "auto",
    display: "flex",
    height: "40px",
    color: theme.palette.secondary.contrastText,
    fontSize: 16,
    textTransform: "capitalize",
    fontWeight: 600,
    boxShadow: "0px 10px 15px #70707028",
    background: theme.palette.primary.main,
    transition: "0.5s",
    "& button": {
      padding: 8,
    },
    "&:hover": {
      transition: "0.5s",
      background: theme.palette.primary.main,
      boxShadow: "0px 10px 15px #70707028",
      opacity: 0.9,
    },
  },

  otpbox: {
    marginLeft: "18px",
    [theme.breakpoints.only("md")]: {
      marginTop: "-8px",
      position: "relative",
    },
    [theme.breakpoints.only("xs")]: {
      marginTop: "0px",
      marginLeft: "0px",
      padding: "0px",
    },
  },
  enterOTP12: {
    position: "relative",
    left: "46px",

    [theme.breakpoints.only("sm")]: {
      left: "0px",
      position: "relative",
    },
  },
  input: {
    width: "100%",
  },
  otpdd: {
    [theme.breakpoints.only("md")]: {
      left: "30px",
      position: "relative",
    },
  },
  buttons: {
    marginTop: "30px",
    [theme.breakpoints.only("md")]: {
      marginTop: "35px",
    },
    [theme.breakpoints.only("xs")]: {
      marginTop: "0px",
      marginLeft: "0px",
    },
    [theme.breakpoints.only("sm")]: {
      marginTop: "-25px",
      marginLeft: "0px",
    },
  },
  profile: {
    borderBottom: `3px solid ${theme.palette.primary.main}`,
    background: theme.palette.background.paper,
    boxShadow: "0px 5px 10px #00000014",
    borderRadius: 8,
    width: "50%",
    margin: "auto",
    textAlign: "center",
    height: "50px",
    alignItems: "center",
    display: "flex",
    justifyContent: "center",
    fontWeight: 600,
    fontSize: 15,
    opacity: 0.8,
    [theme.breakpoints.only("xs")]: {
      width: "97%",
      height: "auto",
      padding: 6,
    },
  },
  hint_title2: {
    textAlign: "end",
    color: "#4BCD3E",
    marginTop: "0px",
    [theme.breakpoints.down("xs")]: {
      marginLeft: "0px",
      textAlign: "left",
      marginTop: "0px !important",
    },
    [theme.breakpoints.down("sm")]: {
      marginTop: "-50px",
      position: "relative",
      right: "40px",
    },
    [theme.breakpoints.down("md")]: {
      position: "relative",
      marginLeft: "0px",
      marginTop: "0px !important",
    },
  },
  phn: {
    color: theme.palette.primary.main,
    marginRight: 8,
    marginLeft: 6,
    [theme.breakpoints.only("xs")]: {
      marginTop: -12,
    },
  },
});
// end
const loginUser = localStorage.getItem('user_decode') ? JSON.parse(atob(localStorage.getItem('user_decode'))) : {};

class MyaccountEditComponent extends React.Component {
  // state
  constructor(props) {
    super(props);
    this.state = {
      submit: false,
      open: false,
      firstName: "",
      lastName: null,
      usertype: null,
      userId: null,
      activationDate: new Date(),
      expirationDate: new Date(),
      addressLine1: null,
      addressLine2: null,
      city: null,
      statevalue: null,
      pincode: null,
      country: null,
      phoneNumber: null,
      officeNumber: null,
      emailId: "NUKK@M.COM",
    };
  }
  // end
  componentDidMount() {
    // the fetch api
    axios
      .get(`${config.api_url}api/v1/users/getAllRegisterCardDetail/${loginUser?.[0]?.userId}`)
      .then((res) => {
        if (res.data) {
          const data = res.data;
          this.setState({
            ...data,
            statevalue: data.state,
            emailId: data?.email,
            usertype: data.userType?.type,
            activationDate: moment(data.activationDate).format("MM/DD/YYYY"),
            expirationDate: moment(data.expirationDate).format("MM/DD/YYYY"),
          });
          localStorage.setItem("groupId", data.userGroupId);
          localStorage.setItem("userId", data.userId);
          localStorage.setItem("institutionId", data.institution?.instId);
        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
  }
  handleChange = (n, v) => {
    const state = this.state;
    this.setState({
      ...state,
      [n]: v,
    });
  };
  // handle submit funcy
  // handlesubmit = () => {
  //     const state = this.state;
  //     this.setState({ ...state, submit: true, open: true })
  //     setTimeout(() => {
  //         this.setState({ submit: false });
  //         this.props.history.push("/home")
  //     }, 3000);
  // }
  // end
  render() {
    const { classes } = this.props;

    const {
      open,
      submit,
      firstName,
      lastName,
      usertype,
      userId,

      expirationDate,
      addressLine1,
      addressLine2,
      city,
      statevalue,
      pincode,
      country,
      phoneNumber,
      officeNumber,
      emailId,
    } = this.state;

    return (
      <div className={classes.root}>
        <Container>
          {/* dialogbox component */}
          {submit && (
            <DialogComponent
              open={open}
              handleClose={this.handleClose}
              component={
                <div>
                  <CheckCircleOutlineIcon className={classes.d_icon} />
                  <Typography variant="subtitle2" className={classes.d_title}>
                    {" "}
                    User profile has been successfully modified.{" "}
                  </Typography>
                  <Button
                    variant="contained"
                    color="primary"
                    disableElevation
                    className={classes.d_btn}
                    onClick={() => this.props.history.push("/home")}
                  >
                    Ok
                  </Button>
                </div>
              }
            />
          )}
          {/* end */}

          {/* Breadcrumbs component */}

          {/* end */}

          {/* card component one*/}
          <Card className={classes.card} variant="outlined">
            <CardContent className={classes.card_title}>
              Cardholder Details
            </CardContent>
            <CardContent className={classes.card_title}>Personal</CardContent>

            <Container>
              <div className={classes.body}>
                <Grid container spacing={2}>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      First Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="First Name"
                      className={classes.input}
                      onChange={(e) =>
                        this.handleChange("firstName", e.target.value)
                      }
                      disabled
                      value={firstName}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Middle Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Middle Name"
                      onChange={(e) =>
                        this.handleChange("lastName", e.target.value)
                      }
                      disabled
                      value={lastName}
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Last Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Last Name"
                      value={usertype}
                      onChange={(e) =>
                        this.handleChange("usertype", e.target.value)
                      }
                      disabled
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Father/Husband's Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Ganesh"
                      onChange={(e) =>
                        this.handleChange("userId", e.target.value)
                      }
                      disabled
                      value={userId}
                      className={classes.input}
                    />
                  </Grid>

                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Mother's Maiden Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Malini  "
                      value={usertype}
                      onChange={(e) =>
                        this.handleChange("usertype", e.target.value)
                      }
                      disabled
                      className={classes.input}
                    />
                  </Grid>

                  <Grid item container xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Martial status
                    </Typography>
                    <Autocomplete
                      fullWidth={false}
                      size="small"
                      style={{ width: "100%" }}
                      value={this.state.validthr}
                      name="reson"
                      options={[{ value: "Married" }, { value: "Un Married" }]}
                      getOptionLabel={(option) => option.value}
                      onChange={(e, v) => this.handleChange("", v)}
                      renderInput={(params) => (
                        <TextField
                          {...params}
                          // helperText={
                          //   props.error?.mCountry &&
                          //   "Please enter your country Code"
                          // }
                          // error={props.error?.mCountry}
                          variant="outlined"
                          placeholder=""
                          className={classes.TextField}
                        />
                      )}
                    />
                  </Grid>

                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Gender
                    </Typography>
                    <Autocomplete
                      fullWidth={false}
                      size="small"
                      style={{ width: "100%" }}
                      value={this.state.validthr}
                      name="reson"
                      options={[{ value: "Male" }, { value: "Female" }]}
                      getOptionLabel={(option) => option.value}
                      onChange={(e, v) => this.handleChange("", v)}
                      renderInput={(params) => (
                        <TextField
                          {...params}
                          // helperText={
                          //   props.error?.mCountry &&
                          //   "Please enter your country Code"
                          // }
                          // error={props.error?.mCountry}
                          variant="outlined"
                          placeholder=""
                          className={classes.TextField}
                        />
                      )}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Email ID
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Email ID"
                      disabled
                      value={emailId?.toLowerCase()}
                      onChange={(e) =>
                        this.handleChange("email", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item container xs={12} sm={6} spacing={2}>
                    <Grid item xs={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Mobile Number
                      </Typography>
                      <Grid
                        item
                        container
                        xs={12}
                        sm={12}
                        spacing={0}
                        style={{ justifyContent: "space-between" }}
                      >
                        <Grid item xs={12} sm={3}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="country Code"
                            disabled
                            value={phoneNumber}
                            onChange={(e) =>
                              this.handleChange("phoneNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                        <Grid item xs={12} sm={8}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Mobile Number"
                            disabled
                            value={officeNumber}
                            onChange={(e) =>
                              this.handleChange("officeNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                      </Grid>
                    </Grid>

                    <Grid item xs={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Office Number
                      </Typography>
                      <Grid
                        item
                        container
                        xs={12}
                        sm={12}
                        style={{ justifyContent: "space-between" }}
                      >
                        <Grid item xs={12} sm={3}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Area Code"
                            disabled
                            value={phoneNumber}
                            onChange={(e) =>
                              this.handleChange("phoneNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                        <Grid item xs={12} sm={8}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Office Number"
                            disabled
                            value={officeNumber}
                            onChange={(e) =>
                              this.handleChange("officeNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                      </Grid>
                    </Grid>
                  </Grid>
                  <Grid item xs={12} sm={6} style={{ marginLeft: "14px" }}>
                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        {" "}
                        Date of Birth
                      </Typography>
                      <KeyboardDatePicker
                        disabled
                        style={{ width: "100%", margin: 0 }}
                        inputVariant="outlined"
                        margin="normal"
                        format="MM/dd/yyyy"
                        value={expirationDate}
                        onChange={(date) =>
                          this.handleChange("expirationDate", date)
                        }
                        KeyboardButtonProps={{
                          "aria-label": "change date",
                        }}
                        size="small"
                      />
                    </MuiPickersUtilsProvider>
                  </Grid>
                </Grid>

                <div>
                  <CardContent className={classes.card_title}>
                    Mailing Address
                  </CardContent>
                </div>
                <Grid container spacing={2} style={{ marginTop: "20px" }}>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Address Line 1
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Address Line 1"
                      disabled
                      value={addressLine1}
                      onChange={(e) =>
                        this.handleChange("addressLine1", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Address Line 2
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Address Line 2"
                      disabled
                      value={addressLine2}
                      onChange={(e) =>
                        this.handleChange("addressLine2", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      City
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="City"
                      disabled
                      value={city}
                      onChange={(e) =>
                        this.handleChange("city", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      State
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="State"
                      disabled
                      value={statevalue}
                      onChange={(e) =>
                        this.handleChange("statevalue", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      PIN Code
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="PIN Code"
                      disabled
                      value={pincode}
                      onChange={(e) =>
                        this.handleChange("pincode", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Country
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Country"
                      disabled
                      value={country}
                      onChange={(e) =>
                        this.handleChange("country", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>

                  <div>
                    <CardContent className={classes.card_title}>
                      Permanent Address
                    </CardContent>{" "}
                    <CheckboxLabels style={{ marginTop: "100px" }} />
                  </div>

                  <Grid container spacing={2} style={{ marginTop: "0px" }}>
                    <Grid item xs={12} sm={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Address Line 1
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Address Line 1"
                        disabled
                        value={addressLine1}
                        onChange={(e) =>
                          this.handleChange("addressLine1", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Address Line 2
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Address Line 2"
                        disabled
                        value={addressLine2}
                        onChange={(e) =>
                          this.handleChange("addressLine2", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        City
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="City"
                        disabled
                        value={city}
                        onChange={(e) =>
                          this.handleChange("city", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        State
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="State"
                        disabled
                        value={statevalue}
                        onChange={(e) =>
                          this.handleChange("statevalue", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        PIN Code
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="PIN Code"
                        disabled
                        value={pincode}
                        onChange={(e) =>
                          this.handleChange("pincode", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Country
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Country"
                        disabled
                        value={country}
                        onChange={(e) =>
                          this.handleChange("country", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                  </Grid>
                </Grid>

                <Grid item xs={12} sm={12} style={{ textAlign: "end" }}>
                  <Button
                    className={classes.clear112}
                    onClick={() => this.handleClear()}
                  >
                    Update Information
                  </Button>
                </Grid>

                <Grid container spacing={4} style={{ marginTop: "10px" }}>
                  <Grid item container xs={12} sm={6} spacing={4}>
                    <Grid item xs={12} sm={12} md={10} lg={10}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Enter registered mobile number
                      </Typography>
                      <TextField
                        type="number"
                        size="small"
                        variant="outlined"
                        placeholder=""
                        //   value={usertype}
                        onChange={(e) => this.handleChange("", e.target.value)}
                        className={classes.input}
                      />
                    </Grid>
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={2}
                      lg={2}
                      className={classes.buttons}
                    >
                      <Button
                        style={{ width: "80px" }}
                        className={classes.clear}
                        onClick={() => this.handleClear()}
                      >
                        Send OTP
                      </Button>
                    </Grid>
                  </Grid>
                  <Grid
                    item
                    container
                    xs={12}
                    sm={6}
                    spacing={2}
                    className={classes.otpbox}
                  >
                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={10}
                      lg={9}
                      className={classes.enterOTP}
                    >
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Enter OTP Number
                      </Typography>
                      <TextField
                        type="number"
                        size="small"
                        variant="outlined"
                        style={{ width: "100%" }}
                        placeholder="OTP Number"
                        className={classes.input}
                        onChange={(e) => {
                          this.handleChange("", e.target.value);
                        }}
                        value={this.state.OTPNumber}
                      />
                    </Grid>

                    <Grid
                      item
                      xs={12}
                      sm={12}
                      md={2}
                      lg={3}
                      className={classes.enterOTP1}
                    >
                      <Button
                        className={classes.clear1}
                        onClick={() => this.handleClear()}
                      >
                        validate
                      </Button>
                    </Grid>

                    <Grid
                      item
                      xs={12}
                      sm={12}
                      className={classes.otpdd}
                      style={{ paddingTop: "0px" }}
                    >
                      <Hidden xsUp>Enter OTP Number</Hidden>
                    </Grid>
                    <Grid
                      item
                      xs={12}
                      sm={6}
                      className={classes.enterOTP12}
                      style={{ paddingTop: "0px" }}
                    >
                      <Typography
                        variant="subtitle2"
                        className={classes.hint_title2}
                      >
                        Resend OTP
                        <ArrowRightIcon
                          style={{ position: "relative", top: "7px" }}
                        />
                      </Typography>
                    </Grid>
                  </Grid>
                </Grid>
              </div>
            </Container>
          </Card>
          {/* end */}

          {/* PhoneInTalkIcon section */}

          {/* end */}
        </Container>
      </div>
    );
  }
}

export default withStyles(styles)(withRouter(MyaccountEditComponent));
